import React from 'react';
import { Row, Col } from 'react-flexbox-grid';

import './App.css';
import BoggleLogo from './images/logo.png';

function App() {
  return (
    <div id='app'>
      <img src={BoggleLogo} className='logo' />
      <div>Current Word, Submit Word Button</div>
      <div id='board'></div>


    </div>
  );
}

export default App;
